import React from 'react';
import { useNavigate } from 'react-router-dom';
import { ArrowLeft, Clock, MapPin, Ticket, QrCode } from 'lucide-react';

const MyEvents = ({ events, theme }) => {
  const isDark = theme === 'dark';
  const navigate = useNavigate();

  const styles = {
    container: {
      padding: '16px',
      minHeight: '100vh',
      backgroundColor: isDark ? '#0f172a' : '#f8fafc',
    },
    header: {
      display: 'flex',
      alignItems: 'center',
      gap: '15px',
      marginBottom: '20px',
    },
    sectionLabel: {
      fontSize: '12px',
      fontWeight: 'bold',
      color: '#94a3b8',
      textTransform: 'uppercase',
      letterSpacing: '1px',
      marginBottom: '15px'
    },
    // Ticket Container
    ticketCard: {
      backgroundColor: isDark ? '#1e293b' : '#fff',
      borderRadius: '20px',
      marginBottom: '20px',
      display: 'flex',
      flexDirection: 'column',
      border: isDark ? '1px solid #334155' : '1px solid #e2e8f0',
      overflow: 'hidden',
      position: 'relative'
    },
    // Ticket Top Section
    ticketMain: {
      padding: '16px',
      display: 'flex',
      gap: '12px',
      borderBottom: '2px dashed #e2e8f0', // The "Tear" line
      position: 'relative'
    },
    // Ticket Bottom Section (The Stub)
    ticketStub: {
      padding: '12px 16px',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      backgroundColor: isDark ? '#1a2234' : '#fafafa'
    },
    // Semi-circles for the ticket look
    cutoutLeft: {
      position: 'absolute',
      bottom: '-10px',
      left: '-10px',
      width: '20px',
      height: '20px',
      borderRadius: '50%',
      backgroundColor: isDark ? '#0f172a' : '#f8fafc',
      zIndex: 2,
      border: isDark ? '1px solid #334155' : '1px solid #e2e8f0'
    },
    cutoutRight: {
      position: 'absolute',
      bottom: '-10px',
      right: '-10px',
      width: '20px',
      height: '20px',
      borderRadius: '50%',
      backgroundColor: isDark ? '#0f172a' : '#f8fafc',
      zIndex: 2,
      border: isDark ? '1px solid #334155' : '1px solid #e2e8f0'
    }
  };

  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <ArrowLeft 
          size={24} 
          onClick={() => navigate(-1)} 
          style={{ cursor: 'pointer', color: isDark ? '#fff' : '#1e293b' }} 
        />
        <h2 style={{ fontSize: '20px', fontWeight: 'bold', margin: 0, color: isDark ? '#fff' : '#1e293b' }}>
          My Tickets
        </h2>
      </header>

      <p style={styles.sectionLabel}>REGISTERED EVENTS ({events.length})</p>

      {events.length > 0 ? (
        events.map(event => (
          <div key={event.id} style={styles.ticketCard}>
            {/* Main Info Section */}
            <div style={styles.ticketMain}>
              <img 
                src={event.image} 
                alt={event.title} 
                style={{ width: '70px', height: '70px', borderRadius: '12px', objectFit: 'cover' }} 
              />
              <div style={{ flex: 1 }}>
                <h4 style={{ margin: '0 0 4px 0', fontSize: '15px', color: isDark ? '#fff' : '#1e293b' }}>
                  {event.title}
                </h4>
                <div style={{ display: 'flex', alignItems: 'center', gap: '5px', fontSize: '12px', color: '#64748b' }}>
                  <Clock size={14} /> {event.date}
                </div>
                <div style={{ display: 'flex', alignItems: 'center', gap: '5px', fontSize: '12px', color: '#64748b', marginTop: '4px' }}>
                  <MapPin size={14} /> {event.location}
                </div>
              </div>
              
              {/* Decorative Cutouts */}
              <div style={styles.cutoutLeft}></div>
              <div style={styles.cutoutRight}></div>
            </div>

            {/* Stub Section with QR Icon */}
            <div style={styles.ticketStub}>
              <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
                <QrCode size={20} color="#2563eb" />
                <div>
                  <div style={{ fontSize: '10px', color: '#94a3b8', fontWeight: 'bold' }}>TICKET ID</div>
                  <div style={{ fontSize: '12px', fontWeight: 'bold', color: isDark ? '#fff' : '#1e293b' }}>
                    #ES-{event.id}2024
                  </div>
                </div>
              </div>
              <button style={{ 
                backgroundColor: '#2563eb', 
                color: '#fff', 
                border: 'none', 
                padding: '6px 12px', 
                borderRadius: '8px', 
                fontSize: '11px', 
                fontWeight: 'bold' 
              }}>
                View Ticket
              </button>
            </div>
          </div>
        ))
      ) : (
        <div style={{ textAlign: 'center', marginTop: '60px', color: '#94a3b8' }}>
          <Ticket size={48} style={{ marginBottom: '10px', opacity: 0.5 }} />
          <p>No active tickets found.</p>
        </div>
      )}
    </div>
  );
};

export default MyEvents;
